site.headStyle:
html, body {
    /* max-width: 100%; */
    /* overflow-x: hidden; */
    /* overflow-y: hidden; */
    /* overflow: hidden; */
}

.header-eclipse {
    position: absolute;
    background: rgba(237, 244, 255, 0.5);
    border-radius: 50%;
}

.header-title-menu {
    position: absolute;

    /* h3 */
    font-family: 'Montserrat';
    font-style: normal;
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
    /* identical to box height, or 133% */

    letter-spacing: 0.1px;

    color: #0667EE;
}

.header-selected-menu {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 18px;
    line-height: 25px;
    /* identical to box height */


    /* 1f1534-hyfen */

    color: #1F1534;
}

.header-menu {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 18px;
    line-height: 25px;
    /* identical to box height */


    /* 1f1534-hyfen */

    color: #1F1534;

    opacity: 0.5;
}


.search-text {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 22px;
    /* identical to box height, or 160% */

    letter-spacing: 0.0075em;

    /* Disabled */

    color: #AAB0B3;
}


.best-job-title {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 48px;
    line-height: 56px;
    /* or 117% */


    color: #000000;

    mix-blend-mode: normal;
}

.best-job-content {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 18px;
    line-height: 32px;
    /* or 178% */


    color: #7D7987;

    mix-blend-mode: normal;
}

.find-dr-btn-text {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 18px;
    line-height: 60px;
    /* identical to box height, or 333% */


    color: #FFFFFF;

    mix-blend-mode: normal;
}

.book-appoint-btn-text {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 18px;
    line-height: 60px;
    /* identical to box height, or 333% */


    color: #0667EE;

    mix-blend-mode: normal;
}

.eclipse-2 {
    position: absolute;
    border-radius: 50%;
    background: #0667EE;
}

.about-us-title {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 45px;
    line-height: 56px;
    /* identical to box height, or 124% */


    color: #000000;

    mix-blend-mode: normal;
}

.about-us-content {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 18px;
    line-height: 32px;
    /* or 178% */

    text-align: center;

    color: #7D7987;

    mix-blend-mode: normal;
}


.job-card-title {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 24px;
    line-height: 150%;
    /* identical to box height, or 36px */


    /* gray/900 */

    color: #18181B;
}

.job-card-pay-rate {
    position: absolute;

    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 24px;
    line-height: 24px;
    /* identical to box height, or 100% */

    letter-spacing: -0.5px;

    color: #3F3F46;
}

.job-card-item {
    position: absolute;

    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 150%;
    /* identical to box height, or 24px */


    /* gray/700 */

    color: #3F3F46;
}

.job-card-skill-tag {
    display: flex;
    flex-direction: row;
    align-items: center;
    padding: 4px 8px;
    gap: 10px;

    position: absolute;
}

.job-card-skill-text {
    width: 50px;
    height: 23px;

    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 22px;
    /* identical to box height, or 160% */


    color: #1F1F1F;
}

