    position: absolute;

    font-family: 'Mulish';
    font-style: normal;
    font-weight: 600;
    font-size: 32px;
    line-height: 56px;
    /* identical to box height, or 175% */


    color: #000000;

    mix-blend-mode: normal;
}

.our-services-content {
    position: absolute;

    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 35px;
    /* or 219% */

    text-align: center;

    color: #555555;

    mix-blend-mode: normal;
}

.eclipse-3 {
    position: absolute;
    border-radius: 50%;
    background: #0667EE;
}
